import React from "react";
import ReactDom, { render } from 'react-dom';
import "./index.css";
const img1 = 'https://source.unsplash.com/weekly?water';
const img2 = 'https://source.unsplash.com/weekly?h2o';
const img3 = 'https://source.unsplash.com/weekly?song';
const img4 = 'https://source.unsplash.com/weekly?dirty-water';
// multiple render
ReactDom.render(<>
<h1 className ="deepak">hello deepak</h1>
<img src = {img1} alt = "water"></img>
<img src = {img2} alt = "h2o"></img>
<img src = {img3} alt = "saline"></img>
<img src = {img4} alt = "song"></img>
</>
,document.getElementById('root'));
// jsx = javascript extention
